    public function getSourceContext(): Source
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Log in!{% endblock %}
    {% block stylesheets %}{% endblock %}

{% block body %}
    <div class=\"container mt-5\">
        <div class=\"row justify-content-center\">
            <div class=\"col-md-6\">
                <div class=\"card\">
                    <div class=\"card-body\">
                        <h2 class=\"text-center\">Login</h2>

                        <form method=\"post\" class=\"mt-4\">
                            <div class=\"form-group\">
                                <input
                                        type=\"email\"
                                        value=\"{{ last_username }}\"
                                        name=\"email\"
                                        id=\"inputEmail\"
                                        class=\"form-control\"
                                        placeholder=\"Email\"
                                        autocomplete=\"email\"
                                        required
                                        autofocus
                                >
                            </div>
                            <div id=\"emailHelp\" class=\"form-text\">We'll never share your email with anyone else.</div>

                            <div class=\"form-group\">
                                <input
                                        type=\"password\"
                                        name=\"password\"
                                        id=\"inputPassword\"
                                        class=\"form-control\"
                                        autocomplete=\"current-password\"
                                        placeholder=\"Password\"
                                        required
                                >
                            </div>

                            <input
                                    type=\"hidden\"
                                    name=\"_csrf_token\"
                                    value=\"{{ csrf_token('authenticate') }}\"
                            >
                            {% if error %}
                                <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
                            {% endif %}

                            {% if app.user %}
                                <div class=\"mb-3\">
                                    You are logged in as {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
                                </div>
                            {% endif %}

                            <button
                                    class=\"btn btn-primary btn-block\"
                                    type=\"submit\">
                                Sign in
                            </button>
                        </form>

                        {% if app.session.get('user') %}
                            <script>
                                // Expose session data as a JavaScript object
                                const userData = {{ app.session.get('user') | json_encode | raw }};
                                console.log(\"Session User Data:\", userData);
                            </script>
                        {% endif %}

                        <div class=\"text-left mt-3\">
                            <a href=\"{{ path('app_home') }}\" class=\"text-muted\">
                                <i class=\"fas fa-arrow-left\"></i> Return to Home
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
{% endblock %}
", "security/login.html.twig", "C:\\xampp\\htdocs\\TRYIT\\templates\\Security\\login.html.twig");
